function convertCleanAmount(amount){return amount/(10**9)}
function convertRealAmount(amount){return amount*(10**9)}
function unsupportedBrowser(){return!window.ethereum||typeof web3===undefined}
function fetch_url(url,callback){fetch(url+"&apiKey=ISW5ZUMM867BR3S7HB4DGXKX3JUYEAPAIY").then(function(response){response.json().then(function(data){callback(data)})})}
function callPHP(name,callback){if(window.location.protocol==='file:')return
let xmlHTTP=new XMLHttpRequest();xmlHTTP.open("GET","../includes/"+name);xmlHTTP.send();xmlHTTP.onreadystatechange=function(){if(this.readyState===4&&this.status===200){callback(this.responseText)}}}
function responseHandler(response,name="pineapple",msg=null){disableLoading(eval(name+"LockedButton"))
if(typeof response==="string"||response===false){alert('#'+name+'-failure',response,msg)}else if(response===true){alert('#'+name+'-success',msg)
updatePineappleExpress()}else{alert('#'+name+'-error',msg)}}
function activateLoading(button){let spans=button.getElementsByTagName('span')
if(!spans)return;button.setAttribute('msg',spans[1].innerText)
spans[0].classList.remove('hidden')
spans[1].innerText=""}
function disableLoading(button){let spans=button.getElementsByTagName('span')
spans[0].classList.add('hidden')
spans[1].innerText=button.getAttribute('msg')}
function sendLot(sender,recipient,lotAmount,gasLimit){lotContract3.methods['transfer'](recipient,lotAmount).send({from:sender,gasPrice:convertRealAmount(5),gas:gasLimit}).on('receipt',function(){responseHandler(true)}).on('error',function(error){if(error['code']===-32603){responseHandler("Initial Gas was too low")}else{responseHandler(false)}})}
function alert(alertID,msg=null){let old=$(alertID).innerText;if(typeof msg==="string"){$(alertID).html(msg);}
$(alertID).fadeIn(300).delay(2000).fadeOut(400);setTimeout(function(){$('#check-input').val('')
let code=alertID.split('-')[0].substring(1)
eval(code+"LockedButton = false")
if(typeof msg==="string"){$(alertID).html(old);}},2700)}
function parseInput(string){let number=parseInt(string);if(!number)throw new Error('invalid number')
return number}
