function initiateScratchTicket(){let lastPoint;let canvas=document.getElementById('scratch-canvas'),canvasWidth=canvas.width,canvasHeight=canvas.height,ctx=canvas.getContext('2d'),image=new Image(),brush=new Image();image.crossOrigin='anonymous';image.src='data:image/png;base64,';image.onload=function(){ctx.drawImage(image,0,0);$('#multipla-multiplier')[0].style.visibility='visible';};canvas.crossOrigin="anonymous";brush.src='data:image/png;base64,';canvas.addEventListener('mousedown',handleMouseDown,false);canvas.addEventListener('touchstart',handleMouseDown,false);canvas.addEventListener('mousemove',handleMouseMove,false);canvas.addEventListener('touchmove',handleMouseMove,false);canvas.addEventListener('mouseup',handleMouseUp,false);canvas.addEventListener('touchend',handleMouseUp,false);function distanceBetween(point1,point2){return Math.sqrt(Math.pow(point2.x-point1.x,2)+Math.pow(point2.y-point1.y,2));}
function angleBetween(point1,point2){return Math.atan2(point2.x-point1.x,point2.y-point1.y);}
function getFilledInPixels(stride){if(!stride||stride<1){stride=1;}
let pixels=ctx.getImageData(0,0,canvasWidth,canvasHeight),p_data=pixels.data,l=p_data.length,total=(l/stride),count;for(let i=count=0;i<l;i+=stride){if(p_data[i]===0){count++;}}
return Math.round((count/total)*100);}
function getMouse(e,canvas){let offsetX=0,offsetY=0,mx,my;if(canvas.offsetParent!==undefined){do{offsetX+=canvas.offsetLeft;offsetY+=canvas.offsetTop;}while((canvas=canvas.offsetParent));}
mx=(e.pageX||e.touches[0].clientX)-offsetX;my=(e.pageY||e.touches[0].clientY)-offsetY;return{x:mx,y:my};}
function handlePercentage(filledInPixels){filledInPixels=filledInPixels||0;if(filledInPixels>50){canvas.style.visibility="hidden";$('body').css('cursor','default')
updateScratchData()}}
function handleMouseDown(e){if(!activeResult)return;isDrawing=true;lastPoint=getMouse(e,canvas);}
function handleMouseMove(e){if(!isDrawing)return;e.preventDefault();let currentPoint=getMouse(e,canvas),dist=distanceBetween(lastPoint,currentPoint),angle=angleBetween(lastPoint,currentPoint),x,y;for(let i=0;i<dist;i++){x=lastPoint.x+(Math.sin(angle)*i)-25;y=lastPoint.y+(Math.cos(angle)*i)-25;ctx.globalCompositeOperation='destination-out';ctx.drawImage(brush,x,y);}
lastPoint=currentPoint;handlePercentage(getFilledInPixels(32));}
function handleMouseUp(_){isDrawing=false;}}
